}
    }
    )
    }
    

    override fun `partyVk`(): List<NodeVerifyingKey> {
            return FfiConverterSequenceTypeNodeVerifyingKey.lift(
    callWithHandle {
    uniffiRustCall() { _status ->
    UniffiLib.uniffi_dkls_fn_method_dkgnode_party_vk(
        it,
        _status)
}
    }
    )
    }
    

    

    


    
