            return FfiConverterTypeDKGNode.lift(
    uniffiRustCall() { _status ->
    UniffiLib.uniffi_dkls_fn_constructor_dkgnode_starter(
    
        FfiConverterTypeInstanceId.lower(`instance`),FfiConverterUByte.lower(`threshold`),_status)
}
    )
    }
    

        
    }
    
